class BankAccount:
    def __init__(self, initial_balance=55):
        self.balance = initial_balance
    def deposit(self, amount):
        self.balance += amount
    def withdraw(self, amount):
        self.balance -= amount
    def overdrawn(self):
        return self.balance < 0

my_account = BankAccount()
my_account.withdraw(5)
print(my_account.balance)

