def string_process(mylistofword):
    """ does some processing"""
    list_of_nums = []

    for word in mylistofword:
        if word.isdigit():
            list_of_nums.append(word)

    if list_of_nums:
        list_of_nums = [int(x) for x in list_of_nums]
        list_of_nums.sort()
        return " ".join([str(x) for x in list_of_nums])
    else:
        return "NONE FOUND"

print(string_process(["machine","ai", "learning"]))

