def main():
    """main function."""
    #gets a line from user
    myline = raw_input()
    if myline:
        list_myline = convert_str_to_list(myline)
        unique_list = []
        freq_list   = []
        for word in list_myline:
                if word not in unique_list:
                        unique_list.append(word)
                        freq_list.append(list_myline.count(word))

        max_freq = max(freq_list)
        fwmf = unique_list[freq_list.index(max_freq)]
        print(fwmf)

def convert_str_to_list(myline):
    """ splitting a line to a list of words"""
    return myline.split()


# Entry point of the script
if __name__ == "__main__":
    main()
